  return (
    <Center>
      <Flex direction='column'>
        <Heading fontSize='70px' mt='25%'>Welcome to Placeholder</Heading>
        <Text textAlign='center' fontSize='20px' fontWeight='bold'>The best recipe storing app</Text>
        <Text textAlign='center' fontSize='40px' fontWeight='bold'><Link to='/register'>Get Started Now</Link></Text>
      </Flex>
    </Center>
  )
}

export default App;
